INSERT INTO `msb_condition` VALUES (1,'1) Usage of App\nUsing of MassSpecBlocks is free. Source codes are licensed under MIT license.\n\n2) Usage of Registration data\nThe name doesn\'t have to be your real name. E-mail is not required and it will be used only for password recovery (Not implemented yet). Password is only hashed and then stored in DB for authentification. There is only one restriction for passwords. Its length must be more than 7 chars.\n\n3) Cookies\nThe site use cookies. Only for this application like storing your session and so on. No third party and advertisements usage. By using MassSpecBlocks you agree with cookie usage.\n\n4) Usage technologies\nMassSpecBlocks use modified smilesDrawer [https://github.com/privrja/smilesDrawer] originally developed by Jean-Louis Reymond Research Group at the University of Bern, main author Daniel Probst. Use JSME editor originally developed by B. Bienfait and P. Ertl. JSME Molecule Editor [https://jsme-editor.github.io/]. Use React for frontend (MIT License), Symfony for backend (MIT License), Mysql free version. MassSpecBlocks is based on Building Blocks Database Generator of Natural Compounds (Bbdgnc) [https://github.com/privrja/bbdgnc].\n\n5) Chemical databases\nWe are using chemical databases for search by user-defined params. These databases are PubChem [https://pubchem.ncbi.nlm.nih.gov], ChemSpider [http://www.chemspider.com], ChEBI [https://www.ebi.ac.uk/chebi], Norine [https://bioinfo.lifl.fr/norine], and PDB [https://www.rcsb.org].\n\nFor ChemSpider, you need to have a user account on it and have created an API key. Which is free of charge to 1000 calls per month. To perform a search on ChemSpider, you need to store this key to the application, and then you can search on ChemSpider from MassSpecsBlocks. The key is stored in the database and is used only for your searches on ChemSpider, nothing more. \n');
/*!40000 ALTER TABLE `msb_condition` ENABLE KEYS */;
UNLOCK TABLES;

